import { useState } from 'react';

import {Route, Routes, Switch, useHistory} from 'react-router-dom';
import Header from "./header/Header";


const App = () => {

  return (
      <Routes>
        <Route path='/' element={<Header/>}/>
      </Routes>
  );
}

export default App;


